import {getCart_DATA} from '../action/ShopCar'

const initialState = {
    getCartDate: [],
};
const ShopCar = (state=initialState,action) => {
    switch (action.type){
        case getCart_DATA:
            return { ...state,getCartDate: action.data };
        default:
            return state;
    }
}

export default ShopCar;
